import styled from 'styled-components';

const MenuTreeStyles = styled.ul`
  li {
    display: inline;
    font-size: 1.7rem;
    font-weight: 300;
    text-transform: capitalize;
    &:last-of-type {
      pointer-events: none;
      cursor: not-allowed;
    }
    &:before {
      content: ' > ';
    }
  }
`;

export { MenuTreeStyles };
